import { Dialog, DialogContent, DialogContentText, DialogTitle } from "@material-ui/core";

const OptionDialog = () => {
    
    const [openDialog, setOpenDialog] = useState(false)
    
    const showDialog = () =>{
        setOpenDialog(true);
    }

    const closeDialog = () =>{
        setOpenDialog(false);
    }
    return ( 
        <div>
            <Dialog
                    open={openDialog}
                    onClose={closeDialog}
                    fullWidth={200}
                    >
                        <DialogTitle id='dialog-option' >Options </DialogTitle>
                        <DialogContent>
                            <DialogContentText>
                                Le sélecteur est obtenu en faisant un click droit sur le champ à automatiser,  
                                Inspecter" puis click droit sur l'élément html et "copy selector"
                            </DialogContentText>
                            <div>
                                
                            </div>

                        </DialogContent>
                        <DialogActions>
                            <Button>
                                Confirmer
                            </Button>
                            
                        </DialogActions>

                    </Dialog>
                    
        </div>
     );
}
 
export default OptionDialog;
